import React, {useState, useEffect} from 'react'



const AppList = () => {

    const [data, setData] = useState({});

    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/users')
            .then(response => response.json())
            .then(json => {
                setData(json)
            })
    }, []);

    return (
        <div className="container-fluid">
            <Row gutter={[16, 16]}>
                {data.map(item = () => {
                    <Col span={8}>
                        sample
                    </Col>
                })}
            </Row>
        </div>
    )
}

export default AppList
